webpackJsonp([0xf1f8de1044bb],{448:function(e,n){e.exports={data:{site:{siteMetadata:{title:"jasperjn's blog",author:"jasperjn",disqus:"jasperjn"}},markdownRemark:{id:"/home/circleci/repo/content/_posts/2017-05-11-cannot-install-extensions-on-vscode/index.md absPath of file >>> MarkdownRemark",html:'<p>更新到 1.12 版後發生無法安裝擴充功能的問題。試圖安裝 tslint 時，點了 Install 之後按鈕變成 Installing 之後又變回 Install 無限輪迴。用 Developer Tools 擷取到的錯誤訊息如下：</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-47e02.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.836158192090394%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ENOENT"\n        title=""\n        src="/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-fb8a0.png"\n        srcset="/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-1a291.png 148w,\n/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-2bc4a.png 295w,\n/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-fb8a0.png 590w,\n/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-526de.png 885w,\n/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-fa2eb.png 1180w,\n/static/enoent-aeaf6a41c5196504f81d3a2390e08d59-47e02.png 1416w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>在官方 GitHub 有人發了類似的 Issue <a href="https://github.com/Microsoft/vscode/issues/25151">#25151</a>。解決方式是到擴充功能安裝的目錄把無法安裝的擴充功能目錄整個刪除，就可以正常安裝了。</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-59197.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.85260770975057%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="擴充功能目錄"\n        title=""\n        src="/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-fb8a0.png"\n        srcset="/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-1a291.png 148w,\n/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-2bc4a.png 295w,\n/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-fb8a0.png 590w,\n/static/extensions-folder-270c447d0106cfabfb949eec02b747c2-59197.png 882w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>如圖所示，把 <code class="language-text">eg2.tslint-0.14.0</code> 目錄刪掉，然後重新安裝 tslint。</p>',frontmatter:{title:"VScode 無法安裝擴充功能",date:"May 11, 2017",tags:["vscode"]}}},pathContext:{slug:"/2017/05/11/cannot-install-extensions-on-vscode/",previous:{fields:{slug:"/2017/04/14/git-template/"},frontmatter:{title:"修改 git init 預設範本",tags:["git"]}},next:{fields:{slug:"/2017/07/17/chrome-build-in-screenshot/"},frontmatter:{title:"使用 Chrome 內建截圖工具擷取網頁畫面",tags:["chrome"]}}}}}});
